import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Modal from '@material-ui/core/Modal';
import Backdrop from '@material-ui/core/Backdrop';
import Fade from '@material-ui/core/Fade';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme) => ({
  form: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
      width: '72ch',
    },
    width: '600px'
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: 200,
  },
  modal: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  paper: {
    backgroundColor: theme.palette.background.paper,
    border: '2px solid #000',
    boxShadow: theme.shadows[5],
    padding: theme.spacing(2, 4, 3),
  },
}));

export default function ChangeInfomationModal() {
  const classes = useStyles();
  const [open, setOpen] = React.useState(false);

  const handleOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div>
      <button type="button" onClick={handleOpen}>
        Chỉnh sửa
      </button>
      <Modal
        aria-labelledby="transition-modal-title"
        aria-describedby="transition-modal-description"
        className={classes.modal}
        open={open}
        onClose={handleClose}
      >
        <Fade in={open}>
          <div className={classes.paper}>
            <form className={classes.form} noValidate autoComplete="off">
              <div>
                <TextField label="Tên" defaultValue="Hello World" />
                <TextField
                  id="date"
                  label="Ngày sinh"
                  type="date"
                  defaultValue="2017-05-24"
                  className={classes.textField}
                  InputLabelProps={{
                    shrink: true,
                  }}
                />
                 <TextField label="Địa chỉ" defaultValue="Hello World" />
                 <TextField label="Email" defaultValue="abc@gmail.com" />
                 <TextField label="Số điện thoại" defaultValue="0123456789" />
              </div>
              <Button
                type="submit"
                form="formLogin"
                fullWidth
                variant="contained"
                color="primary"
                className={classes.submit}
              >
                Lư thay đổi
          </Button>
            </form>
          </div>
        </Fade>
      </Modal>
    </div>
  );
}
